import React from 'react';

const HomeListingCard = ({
  imageURL,
  homeName,
  startingPrice,
  beds,
  baths,
  sqft,
  isMultiSection
}) => {
  //if (!homeName) return (null);
  return (
    <React.Fragment>
      <figure><img src={imageURL} /></figure>
      <div>
        <h5>{homeName}</h5>
        <p>{beds} • {baths} • {sqft}</p>
      </div>
      <div>
        <p>Starting Price</p>
        <p>{startingPrice}</p>
      </div>
    </React.Fragment>
  )
};

export default HomeListingCard;
